<?php

namespace Tests;

use App\Models\Country;
use App\Models\User;
use GuzzleHttp\Client;
use GuzzleHttp\Psr7\Response as GResponse;
use Illuminate\Foundation\Testing\TestResponse;
use Illuminate\Http\Response;

class BaseTestCase extends TestCase
{
    /**
     * Basic Headers for an API call
     *
     * @var array
     */
    protected $basicHeaders = [
        'Content-Type' => 'multipart/form-data',
        'Accept' => 'application/json',
        'X-Requested-With' => 'XMLHttpRequest'
    ];

    /**
     * @return TestResponse
     */
    public function registerUser()
    {
        $country = factory(Country::class)->create([
            'name' => 'England',
            'label' => 'england',
        ]);

        $registerData = [
            "country_id" => $country->id,
            "first_name" => "John",
            "last_name" => "Doe",
            "email" => "John@mail.com",
            "password" => "red6six@123",
            "password_confirmation" => "red6six@123",
            "phone" => "+12345678",
            "address" => "Barclays Bank Plc",
            "dob" => "1998-01-09"
        ];
        return $this
            ->withHeaders($this->basicHeaders)
            ->post('api/auth/register', $registerData);
    }

    public function loginUser(array $data)
    {
        $response = $this
                    ->withHeaders($this->basicHeaders)
                    ->post('api/auth/login', $data);

        return $response;
    }

    public function loginUserWithToken(array $data)
    {
        $response = $this
            ->withHeaders($this->basicHeaders)
            ->post('api/auth/login', $data);

        $response->assertStatus(Response::HTTP_OK);

        $content = json_decode($response->getContent());
        $content = $content->data;
        $token = $content->token_type . ' ' . $content->access_token;

        $headers = $this->basicHeaders;
        $headers['Authorization'] = $token;

        return $headers;
    }

    public function registerAndLoginUser()
    {
        $user = factory(User::class)->create();

        $loginData = [
            'email' => $user->email,
            'password' => 'test@123',
        ];

        $userHeaders = $this->loginUserWithToken($loginData);

        return array($user, $userHeaders);
    }

    public function registerAndLoginAdmin()
    {
        $admin = factory(User::class)->create([
            'email' => 'admin@mail.com',
        ]);

        $loginData = [
            'email' => $admin->email,
            'password' => 'test@123',
        ];

        return $this->loginUserWithToken($loginData);
    }

    public function getPdfImage()
    {
        return 'data:application/pdf;base64,' ;
    }

    public function getJpgImage()
    {
        return 'data:application/jpg;base64,';
    }

    public function getPngImage()
    {
        return 'data:application/png;base64,' ;
    }

    public function getTxtfile()
    {
        return 'data:application/txt;base64,';
    }
}
